import style from "./ModalBurger.module.scss";
import React from "react";
export const ModalBurger = () => {
  const [ toggle, setToggle ] = React.useState(false);
  const handleToggle = () => {
    setToggle(!toggle);
  };
  
  return <><div className={style.modal_img}><img onClick={handleToggle} src="./assets/v.png" alt="" />
    {toggle? <div className={style.modal}></div>: null}
  </div></>;
};
